import ReactFullpage from "@fullpage/react-fullpage";
import React from "react";
import {Section1} from "./Section1";


const pluginWrapper = () => {
    require('../static/fullpage.scrollHorizontally.min')
}

export const Fullpage = () => (
    <ReactFullpage
        //fullpage options
        licenseKey = {'A33BB07C-D80A4947-804397A7-1ACAA14F'}
        scrollingSpeed = {1000} /* Options here */
        pluginWrapper={pluginWrapper}
        scrollHorizontally = {true}  /* Because we are using the extension */
        scrollHorizontallyKey = {'A33BB07C-D80A4947-804397A7-1ACAA14F'}

        render={({ state, fullpageApi }) => {
            return (
                <ReactFullpage.Wrapper>
                    <div className="section">
                        <p>is a</p>
                        <div className="slide" data-anchor="slide1"> developer</div>
                        <div className="slide" data-anchor="slide2"> student</div>
                        <div className="slide" data-anchor="slide3"> Slide 3</div>
                        <div className="slide" data-anchor="slide4"> Slide 4</div>
                    </div>
                    {/*<div className="section">*/}
                    {/*    <p>is a</p>*/}
                    {/*    <p>freelance developer</p>*/}
                    {/*</div>*/}
                    <div className="section">
                        <h2>is on social media</h2>
                        <a href="github.com">GITHUB</a>
                        <p/>
                        <a href="github.com">LINKEDIN</a>
                        <p/>
                        <a href="github.com">TWITTER</a>
                    </div>
                </ReactFullpage.Wrapper>
            );
        }}
    />
);
